/** @format */
import React from "react";

const Form = () => {
   return (
      <div>
         <form>
            <table bgcolor='lightblue' width='800'>
               <tr width='300'>
                  <td border='2' bgcolor='lightblue'>
                     <h1>Add New Activity</h1>
                  </td>
               </tr>
               <hr />
               <tr bgcolor='lightblue'>
                  <label for='name' size='15'>
                     Activity Name:{" "}
                  </label>
                  <input
                     size='25'
                     type='text'
                     placeholder='Type the name of the country'></input>
               </tr>
               <br />
            </table>
            <hr />
            <button>CREAR</button>
         </form>
      </div>
   );
};

export default Form;
